public class Main {
    public static double maximum(double x, double y, double z) {
        double max = x;
        if (y > max) max = y;
        if (z > max) max = z;
        return max;
    }

    public static void main(String[] args) {
        System.out.println(maximum(1.5, 2.7, 1.2));
    }
}
